*,
*:before,
*:after {

    margin: 0;
    padding: 0;
    box-sizing: border-box;
}

.bold {
    display: block;
    margin-top: 3px;
    font-weight: bold;
}

.announcement {
    text-align: center;
    background-color: $errorColor;
    padding: 16px;
    font-weight: bolder;
    font-size: 16px;

    a {

        color: #fff;
        text-decoration: underline;
    }

    span {

        display: inline-block;
        background-color: #F0CEA0;
        color: mix(#000,#DB2B39,20%);
        padding: 12px 14px;
        border-radius: 5px;
        display: inline-flex;
        transition: all 150ms ease-out;
        margin: 0 8px;

        &:hover {

            background-color: mix(#000,#DB2B39,20%);
            color: #fff;
        }
    }
}

.announcement--light {
    background-color: mix(#fff, $errorColor, 15%);
}

body {

    line-height: 1.6;
    font-family: 'Merriweather', serif;
    font-weight: 300;
    font-size: 15px;
    background-color: #fff;
    color: #fff;

    &.is-menu-active {

        overflow: hidden;
    }
}

// Main classes
.container {

    padding: 0 $gutterWidth;
    width: 100%;
    max-width: $maxWidth;
    margin: 0 auto;

    &--small {

        max-width: 800px;
    }

    .container {

        padding: 0;
    }
}

h1 {

    @extend %headline;
}

h2 {

    @extend %headline;
}

h3 {

    font-weight: bolder;
    display: block;
    font-size: 18px;
}

p {

    & + * {

        margin-top: 25px;
    }
}

em {

    font-style: italic;
}

.section__header {

    background-image: url('../img/header.jpg');
